function showContent(c){var a=document.getElementById("contentBody");var d=document.getElementById("loading");a.innerHTML=d.innerHTML;var b=createRequestObject();if(b){b.open("get",c);b.onreadystatechange=function(){if(b.readyState==4){a.innerHTML=b.responseText}};b.send(null)}else{document.location=c}}function createRequestObject(){try{return new XMLHttpRequest()}catch(a){try{return new ActiveXObject("Msxml2.XMLHTTP")}catch(a){try{return new ActiveXObject("Microsoft.XMLHTTP")}catch(a){return null}}}};